const TableComponent = ({ planets, suitabilities }) => {
    const { DataGrid, Column, SearchPanel, HeaderFilter, Editing, Lookup, Popup, Form, Item } = DevExpress.ui;

    // Custom Store for CRUD operations
    const createCustomStore = (planetsData) => {
        let data = [...planetsData];
        return new DevExpress.data.CustomStore({
            key: 'id',
            load: () => Promise.resolve(data),
            insert: (values) => {
                const newId = Math.max(...data.map(item => item.id), 0) + 1;
                const newItem = { id: newId, ...values };
                data = [...data, newItem];
                return Promise.resolve(newItem);
            },
            update: (key, values) => {
                data = data.map(item =>
                    item.id === key ? { ...item, ...values } : item
                );
                return Promise.resolve();
            },
            remove: (key) => {
                data = data.filter(item => item.id !== key);
                return Promise.resolve();
            }
        });
    };

    const store = createCustomStore(planets);

    return (
        <div className="bg-white shadow-md rounded-lg p-4">
            <DataGrid
                dataSource={store}
                showBorders={true}
                noDataText="Ничего не найдено"
                wordWrapEnabled={true}
            >
                <SearchPanel
                    visible={true}
                    width={340}
                    placeholder="Введите данные для поиска..."
                />
                <HeaderFilter visible={true} />
                <Editing
                    mode="popup"
                    allowUpdating={true}
                    allowDeleting={true}
                    allowAdding={true}
                    useIcons={true}
                    texts={{
                        addRow: 'Добавить',
                        deleteRow: 'Удалить',
                        editRow: 'Изменить',
                        saveRowChanges: 'Сохранить',
                        cancelRowChanges: 'Отменить',
                        confirmDeleteMessage: 'Вы действительно хотите удалить?'
                    }}
                >
                    <Popup
                        title="Информация о планете"
                        showTitle={true}
                        width={700}
                        height={450}
                    />
                    <Form>
                        <Item itemType="group" colCount={2} colSpan={2}>
                            <Item dataField="name" />
                            <Item dataField="type" />
                            <Item dataField="distance" />
                            <Item dataField="suitabilityId" />
                        </Item>
                        <Item itemType="group" colCount={1} colSpan={2}>
                            <Item dataField="note" editorType="dxTextArea" editorOptions={{ height: 100 }} />
                        </Item>
                    </Form>
                </Editing>
                <Column
                    dataField="id"
                    caption="Идентификатор"
                    width={100}
                    dataType="number"
                    allowEditing={false}
                />
                <Column
                    dataField="name"
                    caption="Название"
                    dataType="string"
                />
                <Column
                    dataField="type"
                    caption="Тип"
                    dataType="string"
                />
                <Column
                    dataField="distance"
                    caption="Расстояние (св. годы)"
                    dataType="number"
                />
                <Column
                    dataField="suitabilityId"
                    caption="Пригодность"
                    width={150}
                    dataType="number"
                >
                    <Lookup
                        dataSource={suitabilities}
                        valueExpr="id"
                        displayExpr="name"
                    />
                </Column>
                <Column
                    dataField="note"
                    caption="Заметки"
                    dataType="string"
                    width={300}
                />
            </DataGrid>
        </div>
    );
};

export default TableComponent
